import React from 'react';
import {aidos} from '../overview/aidos.png'
import 'bootstrap/dist/css/bootstrap.css';
import './index.css';
import {Link} from 'react-router-dom';



function DeasThreeComponent() {
    return (
        <div>
            <h3>Inspection</h3>
            <h4>ENG</h4>
             <Link to="/hardwfb/one">
                <button className='b1'>
                    Robot Inspection
                </button>
            </Link>
            <Link to="/hardwfb/two">
                <button className='b2'>
                    Field Inspection
                </button>
            </Link>
            <h4>KAZ</h4>
            <h4>RUS</h4>
        </div>
    );
}

export default DeasThreeComponent;
